import React from "react";
import Questiondetails from "./Questiondetails";

const DisplayAnswers = (question) => {
  return (
    <div>
      {
        question.answer.map((ans)=>(
            <div className="display-ans" key={ans._id}></div>
        ))
      }
    </div>
  );
};

export default DisplayAnswers;
